import React, { Component } from 'react';
import { gql } from 'apollo-boost';

class BookList extends Component {
  render() {
    return (
      <div id="main">
        <ul id="book-list">
          <li>Book Name</li>
        </ul>
      </div>
    );
  }
}

export default BookList;
